import { toDisplayString } from '../clock';
export class ValOp {
    id;
    val;
    constructor(id, val) {
        this.id = id;
        this.val = val;
    }
    span() {
        return 1;
    }
    name() {
        return 'val';
    }
    toString() {
        return `"${this.name()}" ${toDisplayString(this.id)} { ${toDisplayString(this.val)} }`;
    }
}
